INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("かりん", 2.0, 118501, 118501, 0, 1, 37, 2, 450, "2021/10/19 12:00:00", "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 118501, "2030/12/31 15:00:00", 118501, 0, 0, "カリン", 787, 0, 0, 0, 37, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ねびあ", 2.0, 118601, 118601, 0, 3, 0, 2, 450, "2024/08/10 21:00:00", "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 118601, "2030/12/31 15:00:00", 118601, 0, 0, "ネビア", 826, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("いお", 2.27, 119001, 119001, 0, 3, 7, 2, 450, "2021/11/03 19:00:00", "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 119001, "2030/12/31 15:00:00", 119001, 15, 0, "イオ（ノワール）", 714, 0, 0, 0, 7, 0, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("くうか", 2.545, 119101, 119101, 0, 3, 7, 2, 450, "2021/11/16 12:00:00", "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 119101, "2030/12/31 15:00:00", 119101, 12, 0, "クウカ（ノワール）", 143, 0, 0, 0, 26, 0, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("まひる", 2.19, 119201, 119201, 0, 1, 6, 1, 450, "2023/09/19 15:00:00", "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 119201, "2030/12/31 15:00:00", 119201, 5, 0, "マヒル（クリスマス）", 397, 0, 0, 0, 6, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("りの", 1.97, 119301, 119301, 0, 3, 8, 1, 450, "2021/12/22 12:00:00", "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 119301, "2030/12/31 15:00:00", 119301, 6, 0, "リノ（クリスマス）", 762, 0, 0, 0, 8, 0, 0);
