INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("るか", 1.3, 120801, 120801, 0, 1, 4, 1, 450, "2023/10/16 15:00:00", "【物理】前衛で雪月花の舞を納める新春の姉御。\n攻撃を当てる度に増加する【剣の刻印】でＵＢとスキルの\n威力を上昇させ、目にも止まらぬ斬撃で敵を圧倒する。", 120801, "2030/12/31 15:00:00", 120801, 2, 0, "ルカ（ニューイヤー）", 193, 0, 0, 0, 22, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("いりや", 1.425, 120901, 120901, 0, 3, 3, 2, 450, "2024/01/26 12:00:00", "【魔法】中衛で自らの血を代償に力を振るう新春吸血鬼。\n自身のＨＰを消費して放つ強力なスキルと、敵からＴＰを\n吸収するスキルを自在に操り、目の前の敵を撃滅する。", 120901, "2024/01/31 11:59:59", 120901, 12, 0, "イリヤ（ニューイヤー）", 424, 0, 0, 0, 38, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ぺこりーぬ", 2.25, 121001, 121001, 0, 3, 5, 1, 450, "2024/02/22 12:00:00", "【物理】前衛で、仲間との絆を力に変え戦う腹ペコ王女。\n敵のＨＰ状態で永続の物理攻撃力上昇と、短時間の特大\n攻撃力上昇＆自己ＴＰ回復を使い分け戦況を一変させる。", 121001, "2024/02/29 11:59:59", 121001, 1, 0, "ペコリーヌ（オーバーロード）", 164, 0, 0, 0, 41, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("きゃる", 2.07, 121101, 121101, 0, 3, 7, 2, 450, "2024/02/22 12:00:00", "【魔法】中衛で仲間との絆を力に変え戦うツンデレ猫娘。\n敵を妨害するスキルと、ＵＢで敵全体を恐慌状態にし既に\n恐慌状態の敵のＴＰをダウンさせ、全戦場を掌握する。", 121101, "2024/02/29 11:59:59", 121101, 1, 0, "キャル（オーバーロード）", 588, 0, 0, 0, 42, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("らびりすた", 1.55, 121201, 121201, 0, 1, 4, 1, 450, "2023/11/16 15:00:00", "【物理】前衛で世界の理をすべて見つめる『迷宮女王』。\n味方を攻撃面で強化し、継続ＨＰ回復を全体に付与する\nスキルで戦線を整え、自身も圧倒的な力で敵を殲滅する。", 121201, "2030/12/31 15:00:00", 121201, 6, 0, "ラビリスタ（オーバーロード）", 260, 0, 0, 0, 40, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("くるみ", 1.9, 121301, 121301, 0, 3, 3, 1, 450, "2022/03/03 19:00:00", "【物理】後衛で、皆のため意を決し奮起する小さな女優。\n残りＨＰが多いほど物理攻撃力がアップし、物理攻撃無効\nバリアのスキルやＨＰ・ＴＰ継続回復で味方を支援する。", 121301, "2030/12/31 15:00:00", 121301, 3, 0, "クルミ（ステージ）", 731, 0, 0, 0, 3, 0, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("みさき", 2.27, 121401, 121401, 0, 3, 7, 2, 450, "2022/03/15 15:00:00", "【魔法】後衛で後ろの味方を強化する魔法少女の看板娘。\n後衛の味方をバリアとＴＰ継続回復で支援し、自分の魔法\n攻撃力に応じ強化される攻撃力アップスキルで鼓舞する。", 121401, "2030/12/31 15:00:00", 121401, 15, 0, "ミサキ（ステージ）", 742, 0, 0, 0, 7, 0, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("あゆみ", 2.0, 121501, 121501, 0, 3, 6, 1, 450, "2024/04/12 12:00:00", "【物理】中衛で、闇夜に身を潜める神出鬼没の怪盗少女。\n敵の目の前から姿を消す隠密スキルや、遠くの敵に対する\nＴＰダウンスキルを駆使して、敵陣後方から瓦解させる。", 121501, "2024/04/15 14:59:59", 121501, 12, 0, "アユミ（怪盗）", 590, 0, 0, 0, 6, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("いのり", 1.425, 121601, 121601, 0, 3, 3, 1, 450, "2022/04/15 15:00:00", "【物理】前衛で闇に紛れ会心の一撃を放つ怪盗ドラゴン。\n隠密効果中、ダメージが大アップし必ずクリティカルする\nＵＢとスキルを駆使し安定したダメージを敵に叩き込む。", 121601, "2030/12/31 15:00:00", 121601, 17, 0, "イノリ（怪盗）", 292, 0, 0, 0, 3, 0, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("あきの", 0.0, 0, 121701, 0, 3, 0, 0, 0, "2015/04/01 15:00:00", "", 0, "2030/12/31 15:00:00", 121701, 0, 0, "アキノ（アキノ＆サレン）", 421, 0, 0, 1, 0, 1, 180901);
