INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("りり", 1.92, 131601, 131601, 0, 3, 4, 1, 450, "2024/07/15 15:00:00", "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 131601, "2024/07/26 11:59:59", 131601, 0, 0, "リリ（サマー）", 399, 0, 0, 0, 4, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("あめす", 1.92, 131701, 131701, 0, 3, 44, 2, 450, "2024/07/31 12:00:00", "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 131701, "2024/08/12 11:59:59", 131701, 0, 0, "アメス（サマー）", 743, 0, 0, 0, 53, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ほまれ", 2.09, 131801, 131801, 0, 3, 7, 2, 450, "2024/08/15 15:00:00", "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 131801, "2030/12/31 15:00:00", 131801, 0, 0, "ホマレ（サマー）", 709, 0, 0, 0, 21, 0, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("じーた", 1.965, 170101, 170101, 0, 3, 34, 1, 450, "2015/04/01 15:00:00", "【物理】前衛で、先手必勝の大技を繰り出す騎空士。\nスキルによるＴＰ回復は、ユニオンバーストの発動を早め\nバトルの序盤から敵前衛に大ダメージを与える。", 105701, "2030/12/31 15:00:00", 170101, 4, 0, "ジータ", 245, 0, 0, 0, 34, 0, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ひより", 1.62, 180101, 180101, 0, 3, 0, 1, 450, "2024/06/30 12:00:00", "【物理】前衛で炎翼を背に敵を粉砕する、陽気な元気娘。\n戦いが続く程に自身の攻撃能力を強めるスキルを操り、\n高めた力で放つ超爆の一撃は、あらゆる敵を塵と化す。", 180101, "2024/07/03 18:59:59", 180101, 7, 0, "ヒヨリ（プリンセス）", 199, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ゆい", 1.92, 180201, 180201, 0, 3, 0, 2, 450, "2024/06/30 12:00:00", "【魔法】後衛から極大魔法で敵を滅する願いの魔法士。\nＴＰを回復しつつ攻撃力を累積アップする補助スキルで\n自身の力を高め、強力な範囲攻撃を放ち敵を一掃する。", 180201, "2024/07/03 18:59:59", 180201, 1, 0, "ユイ（プリンセス）", 767, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("れい", 1.965, 180301, 180301, 0, 3, 0, 1, 450, "2024/06/30 12:00:00", "【物理】中衛で風刃を従え激戦を流麗に征く嵐翼の剣士。\n敵が多い程に効果が高まる自己強化スキルで、自身を奮い\n立たせ、強力な範囲攻撃スキルで一切の敵を鏖滅する。", 180301, "2024/07/03 18:59:59", 180301, 7, 0, "レイ（プリンセス）", 377, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("ぺこりーぬ", 1.965, 180401, 180401, 0, 3, 0, 1, 450, "2024/06/30 12:00:00", "【物理】前衛で、攻防共に絶大な力を誇る腹ペコ王女。\nＨＰが多い時は爆発的な攻撃力で、いかなる敵をも屠り、\nＨＰが減ると自己回復能力を得て、鉄壁の護りを見せる。", 180401, "2024/07/03 18:59:59", 180401, 1, 0, "ペコリーヌ（プリンセス）", 155, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("こっころ", 2.14, 180501, 180501, 0, 3, 0, 1, 450, "2024/06/30 12:00:00", "【物理】中衛で、絶大な補助スキルを繰出す純白の巫女。\n味方の攻撃力とクリティカルダメージを強化しつつ、\n二つの全体回復スキルで味方を堅固に守護し勝利へ導く。", 180501, "2024/07/03 18:59:59", 180501, 1, 0, "コッコロ（プリンセス）", 555, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("きゃる", 1.92, 180601, 180601, 0, 3, 0, 2, 450, "2024/06/30 12:00:00", "【魔法】後衛で、極大魔法を操り敵を討つ姫装の猫娘。\n回復や補助を兼ねた各攻撃スキルを駆使し戦況を整え、\n極大威力のユニオンバーストを撃ち込み敵を燼滅する。", 180601, "2024/07/03 18:59:59", 180601, 1, 0, "キャル（プリンセス）", 747, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("はつねしおり", 1.75, 180701, 180701, 0, 3, 0, 1, 450, "2024/06/30 12:00:00", "【物理】後衛から、真の絆の力を発揮する仲良し姉妹。\n敵の数が増えるほど威力が高まる攻撃スキルと、周りの\n味方を強化するスキルを操り、立ち塞がる敵を一掃する。", 180701, "2024/07/03 18:59:59", 180701, 1, 0, "ハツネ＆シオリ", 732, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("みそぎみみきょうか", 1.5, 180801, 180801, 0, 3, 0, 1, 450, "2024/06/30 12:00:00", "【物理】中衛で敵単体に必殺の一撃を放つ仲良しトリオ。\n３人の力を合わせて放つ攻撃は、相手の弱点に合わせて\n物理から魔法攻撃に変化し、どんな強い敵も退治する！", 180801, "2024/07/03 18:59:59", 180801, 1, 0, "ミソギ＆ミミ＆キョウカ", 465, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("あきのされん", 2.09, 180901, 180901, 0, 3, 0, 1, 450, "2024/06/30 12:00:00", "【物理】中衛で背を預けあう最高の好敵手で親友の二人。\n味方の物理攻撃をサポートしつつＨＰとＴＰを継続回復し\nＨＰが多いほど威力が増すＵＢで、共に勝利の道を征く。", 180901, "2024/07/03 18:59:59", 180901, 1, 0, "アキノ＆サレン", 421, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("あんぐれあ", 2.09, 181001, 181001, 0, 3, 0, 2, 450, "2024/06/30 12:00:00", "【魔法】中衛で、魔力共鳴し連撃を放つマナリアの双姫。\nステータスアップ効果を受けると増加する【友情の魔印】\nがスキルを強化し、波長を合わせた炎の魔槍で敵を討つ。", 181001, "2024/07/03 18:59:59", 181001, 1, 0, "アン＆グレア", 577, 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_80fa0c4f23d6912828eb7c3c6c727fe14e1f3133a968284109eab3c667986ae7` VALUES ("しずるりの", 1.92, 181101, 181101, 0, 3, 0, 1, 450, "2024/06/30 12:00:00", "【物理】中衛でお揃い衣装の、真偽を超えた仲良し姉妹。\n攻守共に味方を支えるシズルと、クリティカル時に強力な\nダメージを与えるリノ、姉妹の絆で困難を跳ね除ける！", 181101, "2024/07/03 18:59:59", 181101, 1, 0, "シズル＆リノ", 551, 0, 0, 0, 0, 1, 0);
